import React, { useState } from "react";
// import { Button, Card, Container, Form, Navbar } from "react-bootstrap";
import Logo from "./assets/img/Brasao_ufra.png";
import SearchIcon from "./assets/icons/search.png"

import './App.css'

const App = () => {
  const [inputValue, setInputValue] = useState('')
  const handleSubmit = (e) => {
    e.preventDefault()

    const formData = new FormData(e.target)
    const data = Object.fromEntries(formData)


    console.log("*** handleSubmit", data)

  }

  const handleInputChange = (e) => {
    console.log("*** handle input change", e.target.value)
    setInputValue(e.target.value)
  }

  return (
    <>


    <form onSubmit={handleSubmit}>
      <input className="input-search" type="text" name="input-common-user" placeholder="Nome do Inseto..." onChange={handleInputChange} value={inputValue}/>
      <button><img src={SearchIcon} alt="icone-procurar" className="icon-search" /></button>
    </form>


    </>
  );
};

export default App;




